import React from "react";
import { Text, View, StyleSheet } from "react-native";

const Main = ({ navigation }) => {
  return (
    <View style={styles.container}>
      <Text>Chưa xong demo</Text>
    </View>
  );
};

export default Main;
const styles = StyleSheet.create({
  container: {
    flex:1,
    justifyContent: "center",
    alignContent: "center",
  },
  text:{
    fon
  }
});
